// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract StudentRecords {

    struct Student {
        string id;
        string name;
        string department;
        string year;
    }

    Student public student;

uint public minimumFee = 0.001 ether;

    function setStudent(
        string memory _id,
        string memory _name,
        string memory _dept,
        string memory _year
    ) public payable {

        require(msg.value >= minimumFee, "Minimum 0.01 ETH required");

        student = Student(_id, _name, _dept, _year);
    }


    function getStudent()
        public
        view
        returns (
            string memory,
            string memory,
            string memory,
            string memory
        )
    {
        return (
            student.id,
            student.name,
            student.department,
            student.year
        );
    }
}
